import './Footer.css';

function Footer() {
  return (
    <div className='footer-container'>
      <section class='social-media'>
        <div class='social-media-wrap'>
          <small class='website-rights'>Sheelmoon Â© 2020</small>
        </div>
      </section>
    </div>
  );
}

export default Footer;
